button.onclick:
// build filter to launch the search
var /*String*/ filter = "";
var /*int*/ terms = 0;

// read TET_NAME field
var /*String*/ TET_NAME = meibo.getFieldValue('TET_NAME');
if (TET_NAME.length != 0) {
  terms++;
  filter = filter + " AND TET_NAME LIKE \'%" + TET_NAME + "%\'";
}

// read TET_COMMENT field
var /*String*/ TET_COMMENT = meibo.getFieldValue('TET_COMMENT');
if (TET_COMMENT.length != 0) {
  terms++;
  filter = filter + " AND (TET_COMMENT LIKE \'%" + TET_COMMENT + "%\' OR TCT_COMMENT LIKE \'%" + TET_COMMENT + "%\')";
}

// read fkTES_ID field
var /*String*/ fkTES_ID = meibo.getFieldValue('fkTES_ID');
if (fkTES_ID.trim().length != 0) {
  terms++;
  filter = filter + " AND fkTES_ID = " + fkTES_ID;
} 

// read fkTTY_ID field
var /*String*/ fkTTY_ID = meibo.getFieldValue('fkTTY_ID');
if (fkTTY_ID.trim().length != 0) {
  terms++;
  filter = filter + " AND fkTTY_ID=" + fkTTY_ID;
}

// check if there is at least one criteria
/*
if (terms == 0) {
  meibo.showField("errorcriteria", true);
  meibo.showField("error", false);
}
else {
*/
  meibo.showField("errorcriteria", false);


  // delete the first AND operator
  if ((filter != "") &&(filter.startsWith(" AND"))) {
    filter = filter.substring(5);
  }


  // launch a first search to know the number of results
  meibo.getField("filter").setValue(filter);
  var /*ResultSet*/ resultSet = meibo.executeResource('Event', filter, 0, '');
  var /*int*/ nEntries = resultSet.getEntryCount();
  if (nEntries != 0) {

    // display table and prepare page number information
    meibo.showField("searchContainer", true);
    meibo.showField("error", false);
    var /*int*/ pageSize = parseInt(meibo.getFieldValue("pageSize"));
    var /*int*/ pages = ((nEntries - 1) / pageSize) + 1;
    meibo.getField("pages").setValue("" + pages);
    meibo.getField("page").setValue("1");

    // launch the search and display results on the same page
    displaySearch('Event', meibo.getFieldValue("attributeList"));
  }
  else {

    // no result found
    meibo.showField("searchContainer", false);
    var /*String*/ msg = null;
    try {
      msg = meibo.getMessage("noResultFound");
    }
    catch (ex) {
    }
    if (msg == null) {
      if (meibo.getUserLanguage() == "fr") {
        msg = "Aucun résultat trouvé. Essayez avec d'autres critères";
      }
      else {
        msg = "No result found. Change search criterias";
      }
    }
    meibo.getField("error").setValue(msg);
    meibo.showField("error", true);
  }
//}

multilist.ondoubleclick:
var table = meibo.getField("results");
var /*int*/ row = table.getSelectedRow();
var /*String*/ dn = table.getRowObject(row);
meibo.switchToDisplayView("Event", dn, 0);

button.onclick:
var /*int*/ page = parseInt(meibo.getFieldValue("page"));
var /*int*/ pages = parseInt(meibo.getFieldValue("pages"));
if (page > 1) {
  page--;
  meibo.getField("page").setValue("" + page);
  displaySearch('Event', meibo.getFieldValue("attributeList"));
}

var /*int*/ page = parseInt(meibo.getFieldValue("page"));
var /*int*/ pages = parseInt(meibo.getFieldValue("pages"));
if (page < pages) {
  page++;
  meibo.getField("page").setValue("" + page);
  displaySearch('Event', meibo.getFieldValue("attributeList"));
}

var /*int*/ pages = parseInt(meibo.getFieldValue("pages"));
meibo.getField("page").setValue("" + pages);
displaySearch('Event', meibo.getFieldValue("attributeList"));
